// MenuBar.js - Holds a list of menu items

import React from 'react';
import './MenuBar.css';

function MenuBar({ isOpen, toggleMenu }) {
    const handleMenuClick = () => {
        if (toggleMenu) {
            toggleMenu();
        }
    };

    return (
        <aside className={`menu-bar ${isOpen ? 'open' : ''}`} onClick={handleMenuClick}>
            <ul className="menu-list">
                {/* Menu items will be added here later */}
                <li className="menu-item">Item 1</li>
                <li className="menu-item">Item 2</li>
                <li className="menu-item">Item 3</li>
            </ul>
        </aside>
    );
}

export default MenuBar;

// Example usage:
// <MenuBar isOpen={true} />
